column8:
2点セット!!スーパーマリオブラザーズ ピーチ姫 コスチューム　大人用/ハロウィン/コスプレ/衣装/仮装/面白い/キャラクター/学園祭/文化祭/学祭/大学祭/高校/イベント<img src=http://image.rakuten.co.jp/mars405/cabinet/costume_soku.jpg border=0 /><br><br>スーパーマリオのキノピオのコスチューム2点セットです。帽子とベストがついています。※Tシャツ、ズボンは含まれません。♪NINTENDOの米国版ライセンス商品です。<br><br>サイズについて<br>■スタンダードサイズ 大人用 身長165～180cm バスト106cmまで ウエスト86cmまで<br>■XLサイズ 身長 180cm～ バスト120cmまで ウエスト 105cmまで<br><br>ハロウィンやコスプレ、パーティに着用して行って目立つこと間違いなし！<br><br><font color=#ff0000></font></DIV>
